#### $\mathrm{STL}$ 大法好！

题意：输入 $n$ 和 $n$ 个字符串，对于每一个字符串，判断它是否在之前输入过，是则输出 `YES`，否则输出 `NO`。

边读入边输出，用一个 $\mathrm{map}$ 判断该字符串是否出现过即可。

---

代码：

```cpp
#include<bits/stdc++.h>
using namespace std;
map <string,bool> k;
int n;
string a;
int main()
{
	cin>>n;
	for(int x=1;x<=n;x++)cin>>a,k[a]?cout<<"YES\n":cout<<"NO\n",k[a]=1;//因为map的初始值为空，所以可以直接判断
	return 0;
}
```

