### 做法：暴力，每输入一个就往前查找，如果有就直接输出“YES”，没有就输出“NO”，这种暴力做法主要靠的是数据只有一百。
```
#include<bits/stdc++.h>

using namespace std;
string Hermione_Granger[10005];
long long Harry_Poter;
int main()
{
	cin>>Harry_Poter;
	for(int i=1;i<=Harry_Poter;i++)
	{
		cin>>Hermione_Granger[i];
		for(int j=i-1;j>=1;j--)
		{
			if(Hermione_Granger[i]==Hermione_Granger[j])
			{
			cout<<"YES"<<endl;
			break;
			}
			if(j==1)
			{
				cout<<"NO"<<endl;
			}
		}
		if(i==1)cout<<"NO"<<endl; 
	}
	return 0;
}
```

