# 有一点点小小的心思
首先这道题其实不难，最重要的是要把控好几个细节，先说一下思路：

我们先输入，然后**从尾到头**查找，如果发现相同，输出YES，没有则输出NO

那么我在这里用了两个小心思：

1. **从尾到头**：理论上来说肯定是如果前面有出现过，一般情况下从尾到头的速度会快一点，当然不排除特殊情况，不过倒着搜的好处是如果出现过三次及以上有好处。

1. **如何跳出循环？？？**

我们先看一下这一段循环的代码：
```cpp
for(j=i-1;j>=1;j--){
	if(st[i]==st[j]){
		cout<<"YES"<<endl;
		j=-1;
	}
}
if(j==0)cout<<"NO"<<endl;
```
这个j的取值很有讲究：首先我们知道**for语句的精髓就在于变量j的变化**，如果就j<=0那么就结束，那么此时**j必定为0**，**不可能再出现-1的情况**。那么如果j==0就一定查找不到，输出NO，但如果j==-1，既可以直接跳出循环，又可以不再重复输出NO，一举两得！！！

那么完整代码就出来了：
```cpp
#include <iostream>
#include <string>
using namespace std;
string st[10001];
int main(){
	int i,j,k,n;
	cin>>n;
	for(i=1;i<=n;i++){
		cin>>st[i];
		for(j=i-1;j>=1;j--){//小心思1
			if(st[i]==st[j]){
				cout<<"YES"<<endl;
				j=-1;//小心思2
			}
		}
		if(j==0)cout<<"NO"<<endl;//小心思2
	}
	return 0;
}
```

### 这是一道$map$的裸题，题意是:给出$n$个字符串，判断它们之前是否出现过，出现过输$YES$，没有出现过输$NO$。
### 那么就用$map$成功$AC$了
```
#include <iostream>//string不能用C党的读入啊qwq
#include <map>//map库
#include <string>//string字符串
using namespace std;
map<string,int>book;//定义一个string,int类型的数组book
int main()
{
	int n,i;
	string a;
	cin>>n;//输入N
	for(i=1;i<=n;i++)
	{
		cin>>a;//输入字符串
		if(book[a]>=1) cout<<"YES"<<endl;//出现过就输YES
			else cout<<"NO"<<endl;//没有就输NO
		book[a]++;//把这个字符串放进桶里
	}
}
```

思路很简单，定义一个map来判断这个字符串是否出现过，判断结果如果为否就先输出no之后再把值加上一位这样之后看到这个全部字符串无脑输出yes
```cpp
#include<bits/stdc++.h>//管他什么鬼全部用万能头
using namespace std;
map<string,int>t;
unsigned long long n;
string a;
signed main()
{
    scanf("%d",&n);//输入n
    for(register int i=1;i<=n;i++)
    {
        cin>>a;//输入字符串
        if(t[a]>=1) cout<<"YES"<<endl;//出现过就输YES
        else cout<<"NO"<<endl;//没有就输NO
        t[a]++;//对应的桶中位置加上一这样下一次判断就输出YES
    }
    exit(0);//好习惯伴我们一生
}
```
接下来我来介绍一下map.

Map是STL的一个关联容器，它提供一对一的数据处理能力，由于这个特性，它完成有可能在我们处理一对一数据的时候，在编程上提供快速通道。这里说下map内部数据的组织，map内部自建一颗红黑树(一种非严格意义上的平衡二叉树)，这颗树具有对数据自动排序的功能，所以在map内部所有的数据都是有序的，后边我们会见识到有序的好处。————百度百科

头文件为#include<map>（STL中的都不加.h）

上面这段话啥意思嘞？就是说map提供了一种自动排序的一对一服务功能，很方便。

map中的swap不是一个容器中的元素交换，而是两个容器所有元素的交换，用的时候要特别小心，另外，map中的元素自动按照key升序排列，因此不能使用sort函数qaq

