一道字符串水题

题意大致如下：

输入$n\left(1\leq n\leq100 \right)$个字符串，对于每个字符串，输出它是否出现过，有输出"YES"，否则输出"NO"，每个字符串长度$1\leq|s|\leq 100$

思路如下：

首先，读入（不必讲了吧）

其次，对于每个字符串，判断是否在前面出现过相同的即可

时间复杂度：$O\left(n^2s\right)$（不超过$10^6$，然而CF数据水，总计时间不超过$1000ms$）

